m, essential oils, shamanism, and various esoteric practices. She is a member of the National Council for Geocosmic Research (NCGR) and The Organization for Professional Astrology (OPA).\r\nPatti’s commitment to empowering others to live life to the fullest enables her to weave her knowledge in her intuitive astrological coaching work while encouraging a healthy lifestyle, with inspiration for a joyful, heartfelt life.',3.99,'Disabled',NULL,1,1,0,NULL,'27467a1f2799dcde3fe9b6f0ddec74ed',0),(65,'reader','email','lifeguides@att.net','Michelle','Bradshaw',NULL,'active','2017-11-29 03:28:48','Michelle','650-270-0940','Tarot Reader, Relationship Specialist, Life Coach','An intuitively gifted counselor, teacher and holistic practitioner, Michelle has been doing tarot readings for the last 25 years. Using the cards as a map she enters into a conversation with her higher self and yours in order to access the highest guidance for your life. She is highly experienced and successful in untangling relationship, work, and spiritual challenges to support you in finding the opportunities that sit in the center of your difficulties. \r\n\r\nShe is a trained intuitive guide, life coach, hypnotherapist, yoga teacher and breath work practitioner. She is passionate about supporting everyone she touches to master their thoughts and manage their moods to support the connection to the authentic self and ignite the spark of divinity within.',3.99,'Disabled',NULL,1,1,0,NULL,'2797b7578b1d4337d5b94b17c449633d',0),(66,'reader','email','seafiremoon@gmail.com','Julie','Moon',NULL,'active','2017-11-29 03:42:20','Julie','928-202-0570','Past Life Regress/Progression Psychic','Julie Moon is an Aura Reader that is certified in Past Life Regression/Progression and in Clinical Hypnotherapy, as well as a certified Herbalist and Dream Interpreter.\r\n\r\nJulie has had the Gift of \"sight\" her whole life. She became aware of being in her body at the age of three.  Julie believed everybody had guides and didn\'t realize this was a special thing until she was about seven when her mother had told her to keep her \"invisible friends\" to herself because not all other people had them. She found that strange but just continued on with what she\'d always known to be normal. Julie began the study of Astrology and Tarot in 1978. \r\n\r\nJulie began working professionally as a Psychic Astrologer and Tarotist in 1982 and has continued on to this day.  She loves doing her work and is happy to help you with any questions you may have. Log in, and together we can uncover what your own guides have to say to you.',3.99,'Disabled',NULL,1,1,0,NULL,'147cce1e7db80e645aba0ce3b934768a',0),(120,'user','email','jay@abc.com','jaydeep','chauhan','1994-10-02','active','2018-01-02 08:47:36',NULL,'9999999999','',NULL,0.00,'Online','2018-01-29 12:04:32',1,1,0,NULL,'7cdbc31d3e3bbb8cb5adb3e91336cbbd',1),(121,'user','twitter','3223959439@gruvimystics.com','Jaydeep','Chauhan','1998-01-02','active','2018-01-02 11:33:27',NULL,'','',NULL,0.00,'Disabled',NULL,1,1,0,NULL,'523303d2c89564d60312d4f0059b486a',1),(122,'admin','email','annroman22@sbcglobal.net','Ann','Roman',NULL,'active','2018-01-03 23:12:11','Sheena','9259987187','Psychic Medium Intuitive','Sheena is a gifted healer with many psychic skills!  She has been and intuitive counselor for way over 40 years along with a medium, healer, tarot, tea leaf readings .  Shes quick and accurate.',2.99,'Disabled',NULL,1,1,0,NULL,'',1),(123,'reader','email','magicrosie111@yahoo.com','Rose','Marvelous',NULL,'active','2018-01-03 23:44:19','Rose','530-310-4452','Psychic Medium ','Rose has amazing gifts and helps many with her words of wisdom and healings.  ',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(124,'user','email','abc@xyz.com','abc','xyz','1994-10-02','active','2018-01-10 11:09:53',NULL,'9999999999','',NULL,0.00,'Disabled',NULL,1,1,0,NULL,'f56dd97854712ffa2d084082b0967718',0),(125,'user','email','abc@abcd.com','abc','acb','1900-10-02','active','2018-01-10 11:12:12',NULL,'1111111111','',NULL,0.00,'Disabled',NULL,1,1,0,NULL,'61277184f5ad88ed4b4483f793382080',1),(126,'reader','email','tyger25474@gmail.com','Angie','Butler-Welch',NULL,'active','2018-01-14 23:23:00','Angie','207-266-1555','Medium Angel cards Clairvoyant Clairaudient Clairsentient Life coach','Angie is a natural born medium, intuitive and empath. Her gift of speaking with Angels, Spirit Guides and those who have crossed over began at a very young age. As a clairvoyant, clairaudient and clairsentient, Angie uses all of her spiritual senses to access your energy and connect with the spirit realm, delivering messages of guidance, love and healing.\r\nAs so much of our life depends upon our own free will, Angie will often access the sacred energy of the Akashic Records* to seek the answers you need, and give you guidance on how your choices will unfold in the future. Angie loves to teach people how to utilize the Law of Attraction to create the life of your dreams. \r\nUpon your request she will also consult Angel Cards for a quick direct message from the angels. Compassionate yet straightforward in her readings, you will be left with a sense of peace, direction and hope. Angie is honored, grateful and humbled to have the gifts bestowed on her from Spirit, and feels it is her responsibility to share the truth that love is eternal, life is a gift of learning, and we are all connected. Namaste.\r\n* The Akashic Records is the sacred energy dimension that records the eternal journey of the soul. Accessing the Akashic Records can help you to explore possible options and outcomes, as well as gain insight into past, current and future situations\r\n',3.99,'Offline','2018-01-15 02:37:24',1,1,0,NULL,'',0),(127,'reader','email','debchr68@aol.com','Debra','Chretien',NULL,'active','2018-01-14 23:35:24','Autumn','202-745-6880','Intuitive Psychic Medium Reiki and Shamballa Healer','Autumn is an intuitive, psychic and medium since early childhood. She uses her natural gifts to answer clients questions and guide them along their life\'s path. While working professionally in New England, Autumn is also a Reiki and Shamballa healer. She is also an Ordained Minister and Law of Attraction Practitioner and Coach. \r\nEmbracing her gift at a young age, Autumn understood the potential of being able to help and guide people. She helps people understand where they\'re at and how to achieve their life purpose and goals. Always encouraging and coming from a place of Love and Light, Autumn can help give you peace and understanding, answering questions about love, work, family or other concerns.  ☆Blessings☆\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(128,'reader','email','sacredspaces7@yahoo.com','Barbara ','Williams',NULL,'active','2018-01-14 23:42:51','Barbara','','Phychic Medium Healer and Medical Intuitive','Dr. Barbara is a well known professional psychic medium, healer, and medical intuitive.   \r\nShe has dedicated over 43 years in the healing and holistic health field, incorporating a wide array of healing modalities.  Barbara teaches psychic development and enjoys helping people open up to their psychic abilities. She organizes several different spiritual and psychic development classes throughout Maine, New Hampshire, and California. Being blessed with her abilities all her life has opened many doors along the way. She has been doing readings most of her adult life. \r\nDr. Barbara is an active participant in paranormal investigations and has her PhD in metaphysics. There are  many opportunities for learning, teaching, and helping others in the paranormal field.\r\n',2.99,'Disabled',NULL,1,1,0,NULL,'',0),(129,'reader','email','cheriwynne@gmail.com','Cheri','Wynne',NULL,'active','2018-01-14 23:47:01','Cheri','310-259-4960','Psychic and Trance Medium Clairvoyant Healer Teacher Past Live','Cheri is a multi generational Psychic and Trance Medium, a natural Clairvoyant, Healer and Teacher. \r\nCheri’s readings are insightful, accurate and healing. She can answer questions about soul mates, past lives, career and money matters. Through dream interpretation, she can remove blocks to help you obtain the information you need to have a balanced life.  Cheri can also contact departed loved ones on the other side while assisting you, in healing your soul, to have a deeper level of spirituality.  Cheri has deep knowledge through her studies in and use of mystery schools, esotericism, metaphysics, past life regressions, tarot, and meditation as well as ancient oracles.\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(130,'reader','email','deborahcv669@yahoo.com','Debbie','Villa',NULL,'active','2018-01-14 23:57:48','debbie','','Energy Healer and Clairvoyant','Debbie is an Energy Healer & Clairvoyant that works off of voice vibration and questions. \r\nDebbie listens as the client speaks.  She receives symbols and images which help Debbie disclose the answers to the client\'s questions.  Debbie is also an energy healer.  Whether at a distance or in-person, she works to balance and bring equilibrium to the body and energy field. \r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(131,'reader','email','transitionsvt@gmail.com','Karlene','Tanner',NULL,'active','2018-01-15 00:06:26','karlene','','Karlene has been a psychic healer and medium her whole life and can help you see the future.','Karlene is a Psychic Medium, Healer, Reiki Master, and Medical Intuitive. \r\nKarlene has been certified as an Akashic Records practitioner and enjoys giving guidance from the sacred soul\r\nenergy. Karlene comes from generations of gifted mediums. As a child, she spent many summers at Camp Etna Spiritualist Camp in Maine, learning first hand from well known mediums and healers from around the world.  From as early as she can remember, Karlene has had the abilities to read people and energy. \r\nKarlene worked, for over 40 years, in traditional medicine, as an RN before retiring and refocusing on her spiritual calling. Karlene is cofounder of The Vision of Light Church in Hartland Vermont. She serves regularly at the Healing Light Spiritualist Church as featured medium and guest speaker. Her journey has now brought her full circle.  Karlene teaches aspiring psychic mediums. She gives messages of love, healing and guidance, assisting others as they maneuver their spiritual path.\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(132,'reader','email','livinlifek@hotmail.com','Kelly Dawn','Purington',NULL,'active','2018-01-15 00:12:11','kellydawn','207-949-1154','Psychic Medium Grief Healing Life Coach','Kelly is a Professional Medium/Psychic who is able to connect with those that have crossed over.  She has a special affinity for working with those who are grieving. Kelly connects quickly with heart, helping to transform inconsolable grief into the beginning of the healing process.\r\n \r\nKelly’s psychic, medium and empathic abilities began in early childhood.  She has not only used them to navigate her life, but to guide others on their path as well. Kelly is also a Master Integrative Life Coach, & Heal Your Heart Coach ( A Spiritual Law based Coaching process), trained by Debbie Ford , best selling author and Life Coach. Kelly has worked with clients all over the world on the grieving process as well as finding their own answers within.\r\n \r\nKelly’s psychic and empathic abilities are used to help those looking for guidance with Career, Finance as well as love life. Kelly is gifted in being able to tap empathically into situations, as well as people, helping to determine what is going on. She has worked with clients worldwide.\r\n \r\nAdditionally, Kelly loves to add new things to her tool box. She is a Certified in Akashic Records, Pranic Healing and in Reiki II.\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(133,'reader','email','laurene@healingwithloveandlight.com','Laurene','Camacho',NULL,'active','2018-01-15 00:18:06','laurene','206-419-7919','Psychic Healer Clairsentient Claircongnizant Empath Medium','Laurene is a Clairsentient, Claircognizant, Empath and Medium\r\nI am the granddaughter of Mary Camacho. Today my grandmother would be called a psychic healer, but in the 1970\'s she was considered a devout Catholic, she also guides me aside the Ascended Masters and Archangels. I have always had my gift, but chose to teach children with special needs, then to stay home with my children after my second was born. I have now been called back to use my gift to help others to find love and light in a world of discord.\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(134,'reader','email','aseret5766@gmail.com','Mariateresa','Forguson',NULL,'active','2018-01-15 00:24:49','mariateresa','775-720-4648','Tarot Reader Ordained Minister Pagan Elder Medium','Mariateresa is a Tarot Reader, Ordained Minister, Pagan Elder, Medium, Paranormal Student and Researcher. Fluent in both English and Italian.\r\nMariateresa was born in Italy, 1966, with a passion for Archaeology and Egyptology. She became a practicing pagan in 2009. In 2010 she started following Goddess Hecate and Goddess Sekhmet. By 2014, Mariateresa acquired the title of Reverend with the Universal Life Church in the States. She has continued her studies into ancient religions and the paranormal.  Always available to whomever may need her help because she pushes the limit of reason to discover the truth.  She is a member of several pagan and esoteric circles and quite the historian. My two beloved cats, Tiger and Bella.\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(135,'reader','email','flyfishingmike22@gmail.com','Michael ','Mallory',NULL,'active','2018-01-15 00:28:27','michael','925-305-6835','Psychic Animal Power and Spirits Clairvoyant','Michael is a Natural Psychic who uses animal power and spirits as his guide.\r\nMichael has always had a intuitive nature about him, even as a child. Being able to physically pick up on the energy people exude, in no time at all!!  Being a strong believer in power animals and Mother Earth’s energy to help people through spiritually, life\'s struggles and cross roads we all encounter.   He nails it every time!! \r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(136,'reader','email','italiagirl_tink@yahoo.com','Nicole','Panzica',NULL,'active','2018-01-15 00:32:06','nicole','408-515-3247','Intuitive Medium and Angel Card Reader','Nicole is an Intuitive Medium and Angel Card Reader.\r\nNicole has had spiritual experiences since she was child. Like many people with her abilities, she often sensed energies and spirit around her. She would see family members and friends who had passed on, orbs of light dancing around her room and hear spirit speaking to her as she drifted off to sleep at night. At times it was hard to understand why she felt anxious when she sensed energy or why her intuition was so strong compared to others. She later learned that these experiences and senses were real and that it was spirit connecting with her, she was a medium.\r\nAs she grew she started to become more aware of her abilities, which has helped her become the beacon of light she is today.\r\nShe fully began her journey of learning how to use her gifts in her early 20’s and today can give accurate and trustworthy readings.\r\nNicole has the abilities to feel, hear, and see spirit. During a reading she can channel spirit and bring forth messages that spirit and your angels want to relay to you. She is also an angel card reader. Using different card decks depending on what questions you have, (love life, career, life purpose and path) Nicole can bring forth guidance and assurance from your angels and help you on your life path.\r\nEmbracing her gift as a medium, Nicole has learned to be proud of who you are and to always chase your dreams no matter what other people think. This is the goal she has in mind for you! When working with her you are truly tapping into light and energy that is positive, loving and nurturing in a spiritual atmosphere.  This light surrounds her every single day and she is happy to share it with the world.\r\nEmbrace love and light always!\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(137,'reader','email','sue@positivelysuccess.com','Sue','Wilhite',NULL,'active','2018-01-15 00:44:06','sue','','Tarot Reader Law of Attraction Coach and Intuitive Healer','Sue is a Tarotist, Law of Attraction coach and Intuitive Healer.\r\nAfter spending 25 years in various IT departments doing programming and database design in the Silicon Valley, Sue decided to catch up and develop her right brain by going back to her early fascination with metaphysics and spiritual studies. She is a Master Tarot consultant, Law of Attraction coach, and sound healer, among other talents and certifications. She specializes in getting her clients unstuck and encouraging them to fulfill their own destinies.\r\n',2.99,'Disabled',NULL,1,1,0,NULL,'',0),(138,'reader','email','tazzpowers@gmail.com','Tazz','Powers',NULL,'active','2018-01-15 00:48:20','tazz','541-661-6785','Personologist Clairsentient Clairaudient','Tazz Powers is a Personologist. \r\nTazz Loves People … she quickly ‘Wraps’ and ‘Delivers’ a reading with accuracy like no other.  She can uncover an overview of the months before you. She is clairsentient, clairaudient and can view and give dates for your transitions throughout the year.  Want to find out about one or more individuals who are also involved in your story?   Birth Dates are all she needs: Month, Day and Year.\r\nTazz Powers is a Personologist, a face reading specialist.  This technique was researched and validated by her mentor Dr. Robert Whiteside in 1940.  It pinpoints personality according to an individual’s physical structure, releasing how that individual will Think, Feel and Act. Send Tazz a ‘clear photo’ from your computer or mobile device; face forward and side profile. She’s off to lift the secrets and tell you about YOU and YOUR FRIENDS!\r\nTazz lectured and taught internationally on TV, radio and was a business/personal consultant in th