ovide information to offer insight into various life issues such as career, relationships, and health.  \r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(144,'reader','email','debbie.sera@gmail.com','Debbie','Sera',NULL,'active','2018-01-23 04:00:26','debbies','650-766-5169','Clairvoyant Clairaudient Works with Spirits, Guides and Angels ','Debbie has been connected with Spirit, Guides and Angels as long as she can \r\nremember. She started expanding her knowledge and sharing her gifts when she was 18.  She allows Spirit, Angels and Guides to work through her to assist others in healing their body, mind and spirit for their highest good. She considers herself as a vessel for the gifts of clairvoyant, clairaudient, and being a highly sensitive intuitive.  At the age of 35 she was diagnosed with breast cancer.  Through her many years of being connected to spirit she was able to heal herself with her knowledge as well as the support of others who where on a similar path. Through that journey she has worked as a hands on healer for over 20 years.  Over the past five years she has expanded her work with long distance work.  In addition to the gifts she was born with she is a Reiki Master, has her Masters Degree in Spiritual Psychology and is a Soul Centered LIfe Coach.  Her purpose in this life time is to be of service to others, assisting them on their healing journey to heal their body, mind or spirit as well as to connect with their Authentic Self.',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(145,'reader','email','planetloveland@gmail.com','Winter ','Longwolf',NULL,'active','2018-01-23 04:46:59','winter','970-290-2081','Lakota Sioux Medicine Psychic Medium Intuitive Energy Work Past, Present and Future','Hello! My name is Winter Longwolf, and I am a psychic medium. As a psychic, I am able to tune into the energy of people and objects by feeling or sensing elements of their past, present, or future. As a medium, I can tune into the spirit energy surrounding individuals.\r\nMy me