ath, answers to prayers, connecting with loved ones from the other side, relationship issues, parenting, life purpose, career changes, health, healing and more.\r\n\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(147,'reader','email','contact@elizabethgood.com','Elizabeth ','Good',NULL,'active','2018-01-23 05:02:35','elizabeth','831-688-2708','Natural Born Psychic Deep Healings','Elizabeth’s wonderfully sparkling combination of highly spiritual and highly practical readings have been delighting, helping and facilitating deep healings to her\r\nmany worldwide clients for over 30 years. A natural born psychic, her humor, compassion, grounded and non-judgmental perspective have given her a devoted following, many who have been with her since the beginning.\r\nShe is known for her well-honed specialty of unique awareness and insights for each client. Many of her dedicated clients remark that just having a session is a greatly\r\nhealing experience.\r\nHer emphasis is always on personal growth; bringing insights, awareness, and tools\r\nto empower her clients to be able to become more responsive and resilient for themselves.\r\nElizabeth excels in being a “practical psychic,” helping her clients to integrate psychic awareness and spiritual realities into daily living.\r\nShe works with individuals, couples (any genders), and groups of most all ages and\r\nall levels of spiritual awareness.',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(148,'reader','email','igetgifts@gmail.com','Kristin','Bruce',NULL,'active','2018-01-23 05:05:01','kristin','714-330-4468',' Angel Therapy, Medium, Akashic Record Consultant, Reiki Master, Guided Imagery Specialist, Hypnotherapist, Healer','I do readings by connecting to your Angels.  I have been giving readings to others for the past 15 years.  You can ask about people, pets, love, money, anything goes!  Your Angels are happy to answer!  During a reading your Angels will point you in a direction that will provide you the most happiness in your life. 