ocal bookstore she discovered Wayne Dyer and Marianne Williamson.  She was beginning to ask the bigger question about life and who we really are.  The teaching school chapter ended, now what?\r\nShe became certified as an Akashic Records Reader in 2014, and is fascinated by the depth and breath of healing that can occur through this practice.  \r\nAccess to the records allows clients to gain detailed information specific to you, your soul group, your life’s purpose, and the why behind what might appear to be happening in your life.  She is excited about service with GruviMystics.\r\n',2.99,'Disabled',NULL,1,1,0,NULL,'',0),(151,'reader','email','kristipederson@cox.net','Kristi','Pederson',NULL,'active','2018-01-23 05:47:45','kristi','402-968-7855','Psychic Medium, Reiki Master, Artist','Kristi Pederson is a psychic medium in Omaha, NE who has been intuitive since childhood.  She has also been able to see and talk to those who have passed over but dismissed it thinking everyone could see and talk to the deceased. It wasn’t until her early 30’s when she realized she was having psychic and mediumistic experiences that no one else had been having. \r\nKristi, also a Reiki Master, was in a session when her client’s recently deceased family member came through so strongly that this ability could no longer be ignored.   After this “awakening” she began searching for answers and reasons for her experiences and became aware of her multi-faceted abilities as a psychic/ medium.  She believes in compassionately sharing her gift with others in an effort to help people heal and grow.\r\n',3.99,'Disabled',NULL,1,1,0,NULL,'',0),(152,'reader','email','mtamross@hotmail.com','Tracy','Ross',NULL,'active','2018-01-23 05:50:36','tracy','207-310-8497','Psychic Medium certified in Akashic Records, Pranic Healing ','Tracy Ross is a professional psychic medium and certified in Akashic records & Pranic healing level 1 with experience in Level 2, She is able to help others connect with past lov